import React from 'react'

class UnirseProtocolo extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            usuario: this.props.usuario,
            numeroTT:''
        }
    }

    cambio(event){
        this.setState({numeroTT:event.target.value})
    }

    render() {
        return (
            <div className="container">
                <h1>¿Desea unirse a un protocolo?</h1>
                <h2>Ingrese el número del protocolo</h2>
                <input type='numTT'
                    value={this.state.numeroTT}
                    onChange={this.cambio}
                    placeholder='             Número TT' />
            </div>
        );
    }
}

export default UnirseProtocolo
